sys_variable_value.value:
(function execute(inputs, outputs) {
  var rh = JSON.parse(inputs.ResponseHeaders);

  if(rh["X-Total-Count"] == "1"){
    //gs.info("Created a codecloud pull request error : " + responseBody.errors[0].message);
    var rb = JSON.parse(inputs.ResponseBody);

    var tokens = rb.result[0].url.split("/");

    outputs.git_repo = (tokens[tokens.length - 1].split("."))[0];
    outputs.user = tokens[tokens.length - 2];

    outputs.statuscode = inputs.statuscode;
  } 
  else {
    outputs.statuscode = inputs.statuscode;
  }
})(inputs, outputs);

